import React from 'react';
import ReactDOM from 'react-dom';
import "./stylesheets/styles-main.css";
import {Header} from "./header.js";

const Source = (props) => {
    return <div>
        <Header className={"header"} lang={props.lang}>
            <div className={"flex-container-logo"}>
                <img src={""} alt={"logo"} />
                <p className={"logo-text"}>ERROR</p>
            </div>
            <div className={"flex-container-navbar"}>
                <a id={"home"} className={"active"} href={"/"}>INFORMATIONEN</a>
                <a id={"rcmd"} className={"link"} href={"/recommendations"}>UNSERE EMPFEHLUNG</a>
            </div>
        </Header>
    </div>;
};

ReactDOM.render(<Source lang={"ENG"} />, document.getElementById("root"));
